import { v4 as uuidv4 } from "uuid";
export const getUUID = () => {
    //看一下本地存储里面是否有
    let uuid_token = localStorage.getItem("UUIDTOKEN");
    //如果没有
    if (!uuid_token) {
        //我生成游客临时身份
        uuid_token = uuidv4();
        //本地存储存储一次
        localStorage.setItem("UUIDTOKEN", uuid_token);
    }
    //切记有返回值,没有返回值undefined
    return uuid_token;
};
